import React, { Component } from 'react'

export default class Home extends Component {
  render() {
    return (
      <div className=''>

        <div className='main'>

            <div className="home-title">
                <h1>Breaking News Now: Stay Updated with the Latest Headlines</h1>
                <p>Welcome to Breaking News Now, your go-to destination for staying informed about the latest happenings around the globe. From politics to technology, sports to entertainment, our app delivers real-time updates and comprehensive coverage of breaking news stories. With our user-friendly interface, you can easily navigate through top headlines, trending stories, and personalized news feeds tailored to your interests. Download Breaking News Now today and never miss a beat in the fast-paced world of news.</p>
            </div>

        </div>

      </div>
    )
  }
}
